import styled from "styled-components";
import Container from "react-bootstrap/Container";
import Layout from "../components/Layout";
import getUser from "../utils/get-user";

export default function Pratice(){
    const user = getUser();
    return (
        <Layout user = {user}>
            <Container>
                <div>
                    Typing area
                </div>
            </Container>
        </Layout>
    )
}
